import React from "react";
import { Col, Container, Row } from "react-bootstrap";

const StudUpdate = () => {
  return (
    <Container>
      <Row className="text-center">
        <Col className="" style={{ backgroundColor: "#68AEDB" }}>
          <Col className="col-auto">
            <h1>PAPA PEDRO</h1>
          </Col>

          <Col>
            <Col
              className="col-2"
              style={{ backgroundColor: "#DEC618" }}
            >h</Col>
            <Col className="col-2" style={{ backgroundColor: "#9900FF" }}>h</Col>
          </Col>
        </Col>
      </Row>
    </Container>
  );
};

export default StudUpdate;
